import "./Nav.scss";
import { Navbar, Nav, NavItem } from "react-bootstrap";

export default function Navigation() {
  return (
    <Navbar
      className="navigation mx-auto"
      fixed="top"
      expand="sm"
      inverse
      collapseOnSelect
    >


      <Navbar.Collapse id="navbarNav" pullRight>
        <Nav pullRight>
          <NavItem>Projects</NavItem>
          <NavItem>Skills</NavItem>
          <NavItem>Experience</NavItem>
          <NavItem>Resume</NavItem>
          {/* <li className='nav-item'><a href="#projects" className='nav-link nitem'>Projects</a></li>
              <li className='nav-item'><a href="#skills" className='nav-link nitem'>Skills</a></li>
              <li className='nav-item'><a href="#experience" className='nav-link nitem'>Experience</a></li>
              <li className='nav-item'><a href="#resume" className='nav-link nitem'>Resume</a></li> */}
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
}
